import React from "react";
import "./App.css";

function App() {
  return (
    <div className="app">
      {/* THIS IS THE CONTAINER FOR THE PHONES IMAGE AND FORM BOX  */}
      <div className="box1">
        <div className="phones"></div>
        <div className="formBox">
          <img src="src/public/photos/instagram.png" alt="Instagram logo" />
        </div>
      </div>
    </div>
  );
}

export default App;
